import './form.css'


const ResetPassword = ()=>{


    function handleSubmmit(){
        console.log()
    }

    return(
        
        <form onSubmit={handleSubmmit} className={'formPassword'}>
            <tex>Informe Seu e-mail</tex>
            <br></br>
            <label>
                <br></br>
                Email:
                <input type="text" name="email"/>
            </label>
            <br></br>
            <button>Resetar</button>
        </form>
        
    )
}

export default ResetPassword;
